import React, {Component} from 'react';
import Ava from './Ava';


class Background extends Component{
    render(){
        return(
            <Fragment>
                <div>
                    <h1>background&avatar</h1>
                </div>
                <Ava /> 
            </Fragment>           
        );

    }
    
}

export default Background;
